synchronized void returnToPool(ChannelSftp channel) {
  ConnectionInfo info = con2infoMap.get(channel);
  HashSet<ChannelSftp> cons = idleConnections.get(info);
  if (cons == null) {
    cons = new HashSet<ChannelSftp>();
    idleConnections.put(info, cons);
  }
  cons.add(channel);

}
